import voiture from "../assets/images/voiture.jpg";
function Card(){
    return(
        <div class="row row-cols-1 row-cols-md-3 g-4 py-5">
            <div class="col">
                <div class="card">
                    <img src={voiture} class="card-img-top" alt="..."/>
                        <div class="card-body">
                            <h5 class="card-title">Nom</h5>
                            <b><p class="card-text">Type</p></b>
                        </div>
                        <div class="mb-5 d-flex justify-content-around">
                            <h3></h3>
                            <a href="#"><button class="btn btn-primary">Detail</button></a>
                        </div>
                </div>
            </div>
        </div>
    );
}
export default Card;
